import React, { useEffect, useState } from "react";
import { Card, Input, Select, Button, Form } from "antd";
import { CheckCircleTwoTone } from "@ant-design/icons";
import { reducer, fetchUsers } from "../others/asyncAction";
import store from "../redux/store";
import { AppInput } from "./UserDetail.style";
const UserDetail = () => {
  const [user, setUser] = useState({
    firstname: "",
    lastname: "",
    email: "",
    city: "",
    country: "",
    isTrue: false,
  });
  const[selectedOption,setSelectedOption]=useState("");
  const handleDropdownChange = (value) => {
    // console.log(value);
    const selectedValue=value;
    setSelectedOption(selectedValue);
  };
  store.subscribe(() => {
    if (store.getState().isTrue) {
      setUser({ isTrue: true });
    }
  });
  async function handleSubmit(event) {
    // setUser({isTrue : true});
    //console.log(event.target.value)
    store.dispatch(fetchUsers());
    localStorage.setItem("user", user.firstname);
    // onFinish();
    // let item={ firstname,lastname,email,city,country}
    // console.warn(item)
    let result = await fetch("https://dev.samarthonline.in/api/v1/user", {
      method: "POST",
      body: JSON.stringify(user),
      headers: {
        "Content-Type": "application/json",
        Accept: "application/json",
      },
    });

    result = await result.json();
    //console.warn("result",result)
    localStorage.setItem("user-info", JSON.stringify(result));
  }
  const onChange = (event) => {
    setUser({ ...user, [event.target.name]: event.target.value });
    console.log(user);
  };
  // const onFinish = (values) => {
  //   console.log("success", values);
  // };
  // const onFinishFailed = (error) => {
  //   console.log("Failed", error);
  // };

  return (
    <div>
      <Card
        hoverable
        borderd={true}
        style={{
          backgroundImage: "linear-gradient(to right,pink,skyblue)",
          marginTop: 100,
          width: "40%",
          height: 700,
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          marginTop: 100,
          marginLeft: 600,
        }}
      >
        <Form style={{ width: 500 }}>
          <h2>Registration Form</h2>
          <Form.Item
            label="First-Name"
            labelCol={{ span: 4 }}
            wrapperCol={{ span: 20 }}
          >
            <AppInput
              placeholder="FirstName"
              name="firstname"
              onChange={onChange}
            />
          </Form.Item>
          <Form.Item
            label="Last-Name"
            labelCol={{ span: 4 }}
            wrapperCol={{ span: 20 }}
          >
            <AppInput
              placeholder="LastName"
              name="lastname"
              onChange={onChange}
            />
          </Form.Item>
          <Form.Item
            label="Email"
            labelCol={{ span: 4 }}
            wrapperCol={{ span: 20 }}
          >
            <AppInput placeholder="Email" name="email" onChange={onChange} />
          </Form.Item>
          <Form.Item
            label="City"
            labelCol={{ span: 4 }}
            wrapperCol={{ span: 20 }}
          >
            <AppInput placeholder="City" name="city" onChange={onChange} />
          </Form.Item>
          <Form.Item
            label="Country"
            labelCol={{ span: 4 }}
            wrapperCol={{ span: 20 }}
          >
            <Select
              value={selectedValue}
              onChange={handleDropdownChange}
              name="country"
              defaultValue="choose"
            >
              {/* options={[
                {
                  value: "India",
                  label: "India",
                },
                {
                  value: "U.S",
                  label: "U.S",
                },
                {
                  value: "Australia",
                  label: "Australia",
                },
              ]} */}
              <Option value="India">India</Option>
              <Option value="USA">USA </Option>
              <Option value="UK">UK</Option>
            </Select>
          </Form.Item>
          <Form.Item
            label="IsActive"
            labelCol={{ span: 4 }}
            wrapperCol={{ span: 20 }}
          >
            <CheckCircleTwoTone
              style={{ fontSize: "15px" }}
              twoToneColor={user.isTrue ? "green" : "red"}
            ></CheckCircleTwoTone>
          </Form.Item>
          <Form.Item wrapperCol={{ offset: 4, span: 20 }}>
            <Button type="primary" onClick={handleSubmit}>
              Submit
            </Button>
          </Form.Item>
        </Form>
      </Card>
    </div>
  );
};
export default UserDetail;

